import React from 'react';
import Stars from './Stars'
// import "./Stars.css";

function StarsList(props){
    return (
        <div className = "planetList-wrapper">
{props.tessStars.map(Stars => {
     return <Stars star ={Stars}/> 
 })}

        </div>
    )
}
export default StarsList;
